import React, { useState } from 'react';
import './App.css';
import Carousel from './Carousel';
import CarouselSettings from './CarouselSettings';
import CentredFocus from './CentredFocus';

const data = [
  {
    title: 'Naruto',
    description: `Naruto is a shinobi of Konohagakure's Uzumaki clan. `,
    image: 'data:image/jpeg;base64,',
  },
  {
    title: 'Hinata',
    description: `Hinata, is a kunoichi of Konohagakure`,
    image: 'data:image/jpeg;base64,',
  },
  {
    title: 'Sasuke',
    description: `Sasuke Uchiha is one of the last surviving members of Konohagakure's Uchiha clan`,
    image: 'data:image/jpeg;base64,',
  },
  {
    title: 'Sakura',
    description: 'Uchiha Sakura, is a kunoichi of Konohagakure',
    image: 'data:image/jpeg;base64,',
  },
  {
    title: 'Kakashi',
    description: ` Hatake Kakashi is a shinobi of Konohagakure's Hatake clan`,
    image: 'data:image/jpeg;base64,',
  },
];

function App() {
  const [cardsToShow, setCardsToShow] = useState(1);
  const [centered, setCentered] = useState(true);

  const handleCardsToShowChange = (value) => {
    setCardsToShow(value);
  };

  const handleCenteredChange = (isChecked) => {
    setCentered(isChecked);
  };
  

  return (
    <div className="App">
      <h1>React Carousel</h1>
      <CarouselSettings
        cardsToShow={cardsToShow}
        centered={centered}
        onCardsToShowChange={handleCardsToShowChange}
        onCenteredChange={handleCenteredChange}
      />
      {centered ? (
        <CentredFocus data={data} cardsToShow={cardsToShow} centered={centered} />
      ) : (
        <Carousel data={data} cardsToShow={cardsToShow} />
      )}
    </div>
  );
}

export default App;
